import React from 'react';
import s from './Profile.module.css';
import MyPosts from "./MyPosts/MyPosts";
import ProfileData from "./ProfileData";

const Profile = (props) => {
    return (
        <div className={s.profilePage}>
            <div>
                <img src='http://novostrojka.by/upload/pic/760d0d546bed5eea4668e7e220c22d38.jpg' className={s.fon} alt=''/>
            </div>

            <div className={s.userData}>
                <div>
                    <img src='https://i.ytimg.com/vi/ToNcTEAEUqo/maxresdefault.jpg' className={s.avatar} alt=''/>
                </div>
                <ProfileData userName={props.state.profiles.userName} birthDay={props.state.profiles.birthDay}
                             city={props.state.profiles.city} aducation={props.state.profiles.aducation}
                             webSite={props.state.profiles.webSite}/>
            </div>

            <MyPosts  posts={props.state.posts}
                      currentPostMessValue={props.state.currentPostMessValue}
                      dispatch={props.dispatch}/>
        </div>

    );
}

export default Profile
